  const [post, setPost] = React.useState(null);

  React.useEffect(() => {

    axios
      .get("https://gist.github.com/Oskar-Dam/ad2c96601e79ad108227bc25f90e4e53", {
        headers: {"Access-Control-Allow-Origin": "*"},
        responseType: "json",
      })
      .then((response) => {
        this.setState({ tableData: response.data });
      });

  }, []);

  React.useEffect(() => {
    console.log("POTIONS")
    console.log(post)
  }, [post]);


